import "../styles/Navbar.css";
import CircleIcon from "./CircleIcon";

type NavbarProps = {
  onClick: () => void;
};

function Navbar({ onClick }: NavbarProps) {
  return (
    <nav className="navbar">
      <CircleIcon icon={<i className="ri-settings-4-line"></i>} />
      <h3 style={{ color: "var(--text-color)" }}>Daily</h3>
      <CircleIcon icon={<i className="ri-pulse-fill"></i>} />
    </nav>
  );
}

export default Navbar;
